/**
 * 自己---正则--性能很差
 * @param {string} str1
 * @param {string} str2
 * @return {string}
 */
var gcdOfStrings = function(str1, str2) {
  for (let i = 0; i <= str2.length; i++) {
    for (let j = str2.length; j > i; j--) {
      let temp = str2.slice(i, j)
      let reg = eval('/^(' + temp + ')+$/g')
      if (str2.search(reg) === 0) {
        if (str1.search(reg) === 0) {
          return temp
        }
      }
    }
  }
  return ''
}




console.log(
  gcdOfStrings(
    '',
    ''
  )
)
